import os
import zlib, base64, marshal, gzip, bz2, lzma

exec(
    marshal.loads(
        gzip.decompress(
            bz2.decompress(
                lzma.decompress(
                    zlib.decompress(
                        base64.b64decode(
                            ""
                        )
                    )
                )
            )
        )
    )
)
